import logo from './logo.svg';
import './App.css';
import { CreateNft } from './pages/createNft.js'

function App() {
  return (
    <div className="App">
      <header>
        <Router>
          <section className="">
            <Routes>
              <Route exact path='/nftup' element={<CreateNft />}/>
            </Routes>
          </section>
        </Router>
      </header>
    </div>
  );
}

export default App;
